import React from "react";
import { useState, useEffect } from "react";
import { Link, useNavigate, useParams } from "react-router-dom";
import Button from "react-bootstrap/Button";
import Form from "react-bootstrap/Form";
import bookingservice from "../service/bookingservice";

const AddBooking = () => {
  const [train_name, setTrainname] = useState("");
  const [train_no, setTrainNo] = useState("");
  const [fname, setFname] = useState("");
  const [lname, setLname] = useState("");
  const [age, setAge] = useState("");
  const [start_from, setStartFrom] = useState("");
  const [destination, setDestination] = useState("");
  const navigate = useNavigate();
  const { id } = useParams();

  const saveBooking = (e) => {
    e.preventDefault();

    const booking = { train_name, train_no, fname, lname, age, start_from, destination };

    if (id) {
      //update
      bookingservice
        .update(booking)
        .then((response) => {
          alert("Details updated Successfully");
          console.log("Booking updated successfully", response.data);
          navigate("/booking")
        })
        .catch((error) => {
          console.log("Something went wrong", error);
        });
    } else {
      // create
      bookingservice
        .create(booking)
        .then((response) => {
          alert("Details Saved");
          console.log("Booking data added successfully", response.data);
          navigate("/booking");
        })
        .catch((error) => {
          console.log("Something went wrong", error);
        });
    }
  };

  useEffect(() => {
    if (id) {
      bookingservice
        .get(id)
        .then((booking) => {
          setTrainname(booking.data.train_name);
          setTrainNo(booking.data.train_no);
          setFname(booking.data.fname);
          setLname(booking.data.lname);
          setAge(booking.data.age);
          setStartFrom(booking.data.start_from);
          setDestination(booking.data.destination);
        })
        .catch((error) => {
          console.log("Something went wrong", error);
        });
    }
  }, []);

  return (
    <div className="container">
      <br></br>
      <br></br>
      <br></br>
      <h3 className="ab">
        <b>
          <u>Add/Update Booking</u>
        </b>
      </h3>
      <form className="form1">
        <br></br>
        <br></br>
        <br></br>
        <div className="form-group">
          {/* <p className="prsub">Customer Name:</p> */}
          <input
            type="text"
            className="form-control col-4"
            id="trainname"
            value={train_name}
            onChange={(e) => setTrainname(e.target.value)}
            placeholder="Enter Train name"
          />
        </div>
        <br></br>
        <div className="form-group">
          {/* <p className="prsub">Customer Address:</p> */}
          <input
            type="text"
            className="form-control col-4"
            id="trainno"
            value={train_no}
            onChange={(e) => setTrainNo(e.target.value)}
            placeholder="Enter TrainNo."
          />
        </div>
        <br></br>
        <br></br>
        <div className="form-group">
          {/* <p className="prsub">Customer Address:</p> */}
          <input
            type="text"
            className="form-control col-4"
            id="fname"
            value={fname}
            onChange={(e) => setFname(e.target.value)}
            placeholder="Enter First Name"
          />
        </div>
        <br></br>
        <br></br>
        <div className="form-group">
          {/* <p className="prsub">Customer Address:</p> */}
          <input
            type="text"
            className="form-control col-4"
            id="lname"
            value={lname}
            onChange={(e) => setLname(e.target.value)}
            placeholder="Enter Last Name"
          />
        </div>
        <br></br>
        <br></br>
        <div className="form-group">
          {/* <p className="prsub">Customer Address:</p> */}
          <input
            type="text"
            className="form-control col-4"
            id="age"
            value={age}
            onChange={(e) => setAge(e.target.value)}
            placeholder="Enter Your Age."
          />
        </div>
        <br></br>
        <br></br>
        <div className="form-group">
          {/* <p className="prsub">Customer Address:</p> */}
          <input
            type="text"
            className="form-control col-4"
            id="startfrom"
            value={start_from}
            onChange={(e) => setStartFrom(e.target.value)}
            placeholder="Enter Start from"
          />
        </div>
        <br></br>
        <br></br>
        <div className="form-group">
          {/* <p className="prsub">Customer Address:</p> */}
          <input
            type="text"
            className="form-control col-4"
            id="destination"
            value={destination}
            onChange={(e) => setDestination(e.target.value)}
            placeholder="Enter Your destination."
          />
        </div>
        <div>
          <button onClick={(e) => saveBooking(e)} id="svep">
            Save
          </button>
          <Link to="/">
            <button className="bckc">Back To list</button>
          </Link>
        </div>
      </form>
    </div>
  );
};

export default AddBooking;
